import { useState, useEffect } from "react";
import { Form, Row, Col, Card, Spinner, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import axios from "axios";

export default function Search() {
  const [query, setQuery] = useState("");
  const [movies, setMovies] = useState([]);
  const [loading, setLoading] = useState(false);
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);

  useEffect(() => {
    const searchMovies = async () => {
      setLoading(true);
      try {
        const response = await axios.get(
          query.length < 1
            ? `https://api.themoviedb.org/3/discover/movie`
            : `https://api.themoviedb.org/3/search/movie`,
          {
            params: {
              api_key: process.env.REACT_APP_TMDB_API_KEY,
              query: query,
              page: currentPage,
              include_adult: false,
              ...(query.length < 1 && { sort_by: 'popularity.desc' })
            }
          }
        );

        setMovies(response.data.results || []);
        setTotalPages(response.data.total_pages);
      } catch (err) {
        console.error("Search error:", err);
        setMovies([]);
      } finally {
        setLoading(false);
      }
    };

    const timer = setTimeout(searchMovies, 500);
    return () => clearTimeout(timer);
  }, [query, currentPage]);

  const Pagination = () => {
    return (
      <div className="d-flex justify-content-center gap-2 my-4">
        <Button 
          variant="outline-primary"
          disabled={currentPage === 1} 
          onClick={() => setCurrentPage(prev => prev - 1)}
        >
          Previous
        </Button>
        <span className="align-self-center">
          Page {currentPage} of {totalPages}
        </span>
        <Button 
          variant="outline-primary"
          disabled={currentPage === totalPages} 
          onClick={() => setCurrentPage(prev => prev + 1)}
        >
          Next
        </Button>
      </div>
    );
  };

  return (
    <div className="p-4">
      <Form className="mb-4" onSubmit={(e) => e.preventDefault()}>
        <Form.Control
          size="lg"
          type="search"
          placeholder="Search for movies..."
          value={query}
          onChange={(e) => {
            setQuery(e.target.value);
            setCurrentPage(1);
          }}
          autoFocus
        />
      </Form>

      {loading && <Spinner animation="border" className="d-block mx-auto" />}

      {!loading && movies.length === 0 && query.length >= 3 && (
        <div className="text-center text-muted mb-4">
          No movies found for "{query}"
        </div>
      )}

      <Row xs={1} md={4} className="g-4">
        {movies?.map((movie) => (
          <Col key={movie.id}>
            <Card className="h-100 shadow-sm">
              <Card.Img
                variant="top"
                src={
                  movie.poster_path
                    ? `https://image.tmdb.org/t/p/w500${movie.poster_path}`
                    : "/placeholder.jpg"
                }
                style={{ height: "400px", objectFit: "cover" }}
              />
              <Card.Body className="d-flex flex-column">
                <Card.Title>{movie.title}</Card.Title>
                <Card.Text className="text-muted small mt-auto">
                  {movie.release_date &&
                    new Date(movie.release_date).getFullYear()}
                  {movie.vote_average &&
                    ` • ⭐ ${Math.min(movie.vote_average, 5).toFixed(1)}`}
                </Card.Text>
                <Link
                  to={`/movie/${movie.id}`}
                  className="btn btn-primary w-100 mt-2"
                >
                  View Details
                </Link>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {totalPages > 1 && <Pagination />}
    </div>
  );
}
